create table facturacion.factura_producto
(
    id_factura_producto int identity
        constraint factura_producto_pk
            primary key nonclustered,
    id_factura          int
        constraint factura_producto_factura_id_factura_fk
            references facturacion.factura,
    id_producto         int
        constraint factura_producto_producto_id_producto_fk
            references facturacion.producto,
    cantidad            int
)
go

